    false,nt"url": null,nt"notes": "Black tern breeding pair surveys have been
    conducted in Vermont every year since 1990, except during 2006. Initially, there
    were 3 separate nesting populations of black terns at: (1) Dead Creek (Panton Road,
    Route 17, West Road, and Little Otter Creek), (2) Memphremagog (South Bay WMA),
    and (3) Missisquoi (Mud Creek WMA and Missisquoi NWR). Nesting at Dead Creek was
    observed for the last time in 1998, and at Memphremagog, nesting was last observed
    in 1999. Of the 3 populations, Missisquoi always had the most (63-97%) nesting pairs,
    followed by Dead Creek (2-31%), and then Memphremagog (3-8%). For the Missisquoi
    population, Missisquoi NWR held the majority (70-99%) of black tern breeding pairs
    with Mud Creek WPA holding 1-32%. In both 2002 and 2003, only one pair of nesting
    black terns was observed at Mud Creek WPA. Since 2004, all of Vermontu2019s endangered
    breeding black terns have nested at Missisquoi NWR. Surveys: During",nt"license_title":
